func RandomUnitSphereInteriorPoint() *[3]float64 {
  return &(unitSphereInterior[rand.Intn(len(unitSphereInterior))])
}

func RandomUnitSphereSurfacePoint() *[3]float64 {
  return &(unitSphereSurface[rand.Intn(len(unitSphereSurface))])
}

func RandomNormallyDistributedNumber(mean, stddev float64) float64 {
  return stddev * normalDistribution[rand.Intn(len(normalDistribution))] + mean
}

func RandomNormallyDistributedVector(dim int, mean, stddev float64) []float64 {
  vec := make([]float64, dim)

  for i := 0; i < dim; i ++ {
    vec[i] = RandomNormallyDistributedNumber(mean, stddev)
  }

  return vec
}
